function TechPage(props){
    return(
        <div>
            <h1>Tech Page!</h1>
            {
                props.data.map(items=>(
                    <div key={items.num}>
                        <img src="/images/cspursue.png" className="logo" alt="img-art"/>
                    </div>
                ))
            }
        </div>
    )
}

export default TechPage;
